import axios from "axios";
import { useEffect, useState } from "react";
import Track from "../Track/Track";

export default function Queue() {

    const [queue, setQueue] = useState([]);

    useEffect(() => {
        axios.get("queue/get")
        .then((response) => setQueue(response.data))
        .catch((error) => {
            console.log(error);
        });
    }, []);

    return <div>

    </div>;
}
